INSERT INTO `post` (`id`, `created_at`, `created_by`, `description`, `detail`, `image`, `slug`, `status`, `title`, `topic_id`, `type`, `updated_at`, `updated_by`) VALUES
(1, '2025-03-22 21:11:09.000000', 1, 'Thông tin về iPhone mới nhất của Apple', 'Apple vừa ra mắt iPhone mới với nhiều tính năng đột phá. Sản phẩm này được kỳ vọng sẽ tạo ra làn sóng mới trong thị trường smartphone.Với chip mới, camera được nâng cấp và pin có thời lượng dài hơn, iPhone mới đã nhận được nhiều đánh giá tích cực từ các chuyên gia công nghệ.', 'https://bizweb.dktcdn.net/100/497/960/files/chi-tiet-dung-luong-pin-cua-dien.jpg?v=1696430963735', 'apple-ra-mat-iphone-moi', 2, 'Apple ra mắt iPhone mới', 1, 'post', NULL, NULL),
(2, '2025-03-24 20:31:58.000000', 1, 'Thông tin về iPhone mới nhất của Apple', 'Ấn tượng ban đầu về iPhone 15 Pro Giống như người anh Pro Max, 15 Pro chỉ đi kèm duy nhất một phụ kiện là cáp USB-C. Không ít khách hàng cho rằng họ xứng đáng nhận được nhiều hơn là một dây sạc. Tuy nhiên, thay đổi trên đã mang đến những tác động tích cực cho cả nhà sản xuất và môi trường. Cầm điện thoại trên tay, điều đầu tiên gây ấn tượng là trọng lượng khá nhẹ. iPhone 15 Pro nhẹ hơn phiên bản tiền nhiệm khoảng 19 gram. Thiết bị được các kỹ sư Apple dành nhiều giờ đồng hồ để hoàn thiện với chất liệu titan cao cấp.Thay vì sở hữu vẻ ngoài bóng loáng, cạnh viền như dao cạo, 15 Pro mới vẫn giữa nguyên thiết kế thời thượng nhưng tinh tế và linh hoạt hơn. Các đường cong nhẹ, bo cạnh mềm mại kết hợp lớp sơn mờ chống bám dính mồ hôi giúp người dùng cầm nắm thoải mái, dễ dàng.Bên cạnh đó, nút Hành động không còn là một công cụ đơn giản để bật/tắt tiếng đơn giản, chi tiết mới tích hợp nhiều tác vụ thú vị và hấp dẫn.Chất lượng hình ảnh và âm thanh trên iPhone 15 Pro gần như không có điểm trừ. Màn hình Super Retina OLED, đi kèm tần số quét 120Hz, và độ sáng tối đa lên đến 2000 nits hứa hẹn cho trải nghiệm xem phim, lướt web giải trí đỉnh cao. Mặc dù không được trang bị ống kính tiềm vọng như 15 Pro Max nhưng những gì bạn nhận được ở iPhone 15 Pro là điều tốt nhất trong phân khúc giá. Các tín đồ công nghệ đã dành lời khen cho khả năng nhiếp ảnh cũng như tỏ ra thích thú với độ dài tiêu cự hợp lý trên 15 Pro. Hiệu năng phần cứng vẫn luôn được đông đảo dân công nghệ quan tâm. Chip A17 Pro dường như là nâng cấp mà Apple tạo ra sự khác biệt giữa dòng sản phẩm thông thường và dòng Pro cao cấp hơn. Cấu hình khủng của 15 Pro có thể cân đẹp các tác vụ đòi hỏi khả năng xử lý tốt. ', 'https://bizweb.dktcdn.net/100/497/960/files/dap-hop-iphone-15-pro-thiet-ke-l2.jpg?v=1696430567952', 'iphone-15-pro', 2, 'Đập hộp iPhone 15 Pro', 1, 'post', NULL, NULL),
(3, '2025-03-24 20:50:28.000000', 1, 'Thông tin về iPhone mới nhất của Apple', 'Thông tin chi tiết về iPhone 15 SeriesViệc tăng giá này có thể được quy cho việc giới thiệu một công nghệ titan mới và cải tiến trong phần cứng máy ảnh. Tuy nhiên, các mẫu iPhone 15 và iPhone 15 Plus cơ sở dự kiến sẽ duy trì các thẻ giá hiện tại của chúng.Theo một báo cáo của nhà phân tích Luke Lin của Digitimes, sẽ có tăng giá đáng kể cho iPhone 15 Pro và iPhone 15 Pro Max so với sản phẩm tiền nhiệm.Điều chỉnh giá này có khả năng chiếm một số cải tiến phần cứng được đồn đại, bao gồm cả việc chuyển từ thép không gỉ sang khung Titanium cho iPhone 15 Pro và giới thiệu hệ thống camera Periscope trên iPhone 15 Pro Max, cho phép tăng khả năng thu phóng quang học lên tới 5-6x. Tuy nhiên, giá cho các mẫu iPhone 15 và iPhone 15 Plus tiêu chuẩn dự kiến sẽ không thay đổi.Nếu việc tăng giá này có hiệu lực, iPhone 15 Pro Max có thể trở thành iPhone đắt nhất từng được phát hành. Hiện tại, iPhone 14 Pro Max nắm giữ tiêu đề đó. IPhone 14 Pro và iPhone 14 Pro Max đã được ra mắt vào năm ngoái với giá khởi điểm lần lượt là $999 và $1,099.Mặc dù giá mới chính xác không được chỉ định, một báo cáo trước đây cho thấy iPhone 15 Pro có thể bắt đầu ở mức 1.099$, sẽ nhiều hơn 100$ so với người tiền nhiệm, trong khi iPhone 15 Pro Max có thể bắt đầu ở mức 1,299$, tăng 200$ so với iPhone 14 Pro Max.', 'https://bizweb.dktcdn.net/100/497/960/files/iphone-15-pro.jpg?v=1696580132980', 'mau-iphone-titan', 2, 'Các mẫu iPhone 15 Pro sẽ tăng giá do trang bị khung máy bằng titan', 3, 'post', NULL, NULL),
(4, '2025-03-24 20:53:55.000000', 1, 'Thông tin về iPhone mới nhất của Apple', '3 điểm nổi bật nhất của Claude AI.1, Cho phép upload tài liệu PDF, TXT, EXCEL lên hệ thống để AI tóm tắt, phân tích đưa ra đánh giá dựa trên tài liệu đó. Do vậy nội dung sáng tạo theo yêu cầu rất tốt.2, Token đầu ra của con AI này lên đến 100K (75K chữ) trong khi chatgpt chỉ tối đa 8K token 1 lần (~6k chữ).3, Trả lời thông minh và có chiều sâu hơn chatgptClaude AI là gì?Claude AI, do Anthropic phát triển, là một chatbot AI có tính năng và độ tin cậy cao. Ứng dụng này đã được huấn luyện trên một lượng dữ liệu lớn bao gồm cả văn bản và mã nguồn. Claude AI có khả năng tạo ra nội dung văn bản, dịch thuật, sáng tạo các loại nội dung khác nhau, tóm tắt nội dung và trả lời các câu hỏi mà bạn đặt ra. Lưu ý rằng nội dung của bạn phải viết bằng tiếng Việt, vì đối tượng người dùng của Claude AI được xem là người Việt Nam.Cách đăng ký tài khoản Claude AITrước khi tìm hiểu về cách sử dụng Claude Ai, chúng ta sẽ cùng đi tìm hiểu về cách đăng ký ứng dụng này trước. Claude AI hiện tại chỉ hỗ trợ 2 khu vực là Hoa Kỳ và Vương quốc Anh. Do đó, để thực hiện cách đăng ký sử dụng Claude AI, bạn sẽ cần thay đổi VPN của mình về một trong hai khu vực trên.Link đăng ký:https://claude.ai/login Sử dụng email để lấy code đăng nhập', 'https://bizweb.dktcdn.net/100/497/960/files/claude-ai.jpg?v=1696429345535', 'AI', 2, 'Thủ thuật đăng ký Claude Ai và cách dùng hiệu quả', 2, 'post', NULL, NULL),
(5, '2025-03-24 20:56:55.000000', 1, 'Thông tin về iPhone mới nhất của Apple', 'Thông tin chi tiết về Galaxy A55 5G Một trong những điểm nổi bật chính của Galaxy A55 là việc sử dụng chip Exynos 1480 Soc của Samsung. Chipset này dự kiến sẽ là một cải tiến đáng kể so với những người tiền nhiệm của nó, thậm chí có thể kết hợp GPU có nguồn gốc AMD. Sự thay đổi trong công suất xử lý này có thể cung cấp hiệu suất nâng cao cho người dùng.Một tính năng đáng chú ý khác là cảm biến camera phía sau chính 50 megapixel được đồn đại, đầy hứa hẹn khả năng chụp ảnh được cải thiện so với người tiền nhiệm của nó. Mặc dù một thông báo chính thức đang chờ xử lý, nhưng Samsung có thể tiết lộ Galaxy A55 vào tháng 3 của năm sắp tới.Sản phẩm có nhiều tùy chọn màu sắc khác nhau và cung cấp một bộ tính năng chắc chắn, bao gồm màn hình siêu AMOLED 120Hz, camera ba mặt sau và pin 5.000mAh.Khi Samsung tiếp tục đổi mới trong dòng điện thoại thông minh tầm trung, người tiêu dùng có thể dự đoán các nâng cấp và nâng cao hiệu suất trong Galaxy A55, khiến nó trở thành một tùy chọn hấp dẫn cho những người tìm kiếm sự cân bằng giữa các tính năng và khả năng tài chính.', 'https://bizweb.dktcdn.net/100/497/960/files/samsung-galaxy-a55-chay-tren-exynos.jpg?v=1696429576916', 'sam-sung', 2, 'Rò rỉ Samsung Galaxy A55 chạy trên Exynos 1480 SoC', 1, 'post', NULL, NULL);

